        <div className="grod grid-cols-8 bg-white">
          {/* Products */}
          <div className="col-span-6">
            <div className="text-2xl xl:text-3xl m-4"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Checkout;
